"     Clostridium difficile",
"    </em>",
"    colitis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 394px; height: 313px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Right lower quadrant intestinal ultrasound, 13-year-old girl with Down syndrome and acute lymphoblastic leukemia. This was her third episode of frequent voluminous watery diarrhea without blood or mucus following initiation of intravenous antimicrobial treatment for fever and neutropenia.",
"    <em>",
"     C. difficile",
"    </em>",
"    toxin A/B enzyme immunoassay was positive for both of the previous episodes. It was negative on the first two days of the present admission, then positive on day three when diarrhea worsened. Plain films showed marked paucity of intestinal gas; ultrasound showed up to 4 mm of bowel wall thickening in both right (above) and left lower quadrants.",
