"   <div class=\"block mop drugH1Div\" id=\"F13459510\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Susceptibility testing is recommended in patients who fail",
"     <i>",
"      H. pylori",
"     </i>",
"     -eradication regimen.",
"    </p>",
"   </div>",
