var title_f25_62_26603="Tx AF after pneumonectomy";
var content_f25_62_26603=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F69512&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F69512&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Suggested guidelines for the treatment of atrial fibrillation after pneumonectomy",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Anticoagulation with heparin*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Drug for rate control",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Electrical cardioversion if hemodynamically unstable or no reversion to sinus rhythm in 24 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        If no recurrence, discontinue rate control drug in 4 to 8 weeks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        If recurrence, start antiarrhythmic drug",
"        <sup>",
"         &Delta;",
"        </sup>",
"        or electrical cardioversion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        If no recurrence, discontinue antiarrhythmic agent in 4 to 8 weeks and rate control drug in 12 weeks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        If second recurrence, anticoagulate with warfarin. If no response in 6 to 12 weeks, attempt electrical cardioversion",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * If no contraindication to anticoagulation.",
"     <br>",
"      &bull; Beta-adrenergic blockers are the first choice unless contraindicated. If so, diltiazem is recommended. Digoxin may be used in patients with left ventricular dysfunction.",
"      <br>",
"       &Delta; Includes procainamide, quinidine, disopyramide, flecainide, propafenone, amiodarone, sotalol, and ibutilide. Amiodarone should be used with caution due to reports of ARDS developing after pneumonectomy.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from Ommen SR, Odell JA, Stanton MS, N Engl J Med 1997; 336:1429.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
